import {Chart,Interval, Tooltip, Axis, Coordinate, Interaction, getTheme} from 'bizcharts';

function PieChart() {
	const data = [
		{ item: 'hello', count: 40, percent: 0.4 },
		{ item: 'hello', count: 21, percent: 0.21 },
		{ item: 'hello', count: 17, percent: 0.17 },
		{ item: 'hello', count: 13, percent: 0.13 },
		{ item: 'hello', count: 9, percent: 0.09 },
	];

	const cols = {
		percent: {
			formatter: val => {
				val = val * 100 + '%';
				return val;
			},
		},
	};


	return (  
	<Chart height={400} autoFit data={data} interactions={['active-region']} padding={[30, 30, 30, 50]} >
    	<Interval position="year*sales" />
    	<Tooltip shared />
  </Chart>
	);
}

export default PieChart
